import * as React from 'react';
import { Route, Switch, Redirect, Link } from 'react-router-dom';

import PageAdminSurveys from './routes/PageAdminSurveys';
import PageAdminConfig from './routes/PageAdminConfig';

import queryString from 'query-string';

export default class PageAdminLayout extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="PageAdmin">
        <h1>Admin</h1>
        <div style={{ display: 'flex' }}>
          <button onClick={() => this.props.history.push('/app/admin/surveys')}>
            Surveys
          </button>
          <button onClick={() => this.props.history.push('/app/admin/config')}>
            Config
          </button>
        </div>
        <br />
        <Switch>
          <Route
            exact
            path="/app/admin/surveys"
            render={props => <PageAdminSurveys {...this.props} />}
          />
          <Route
            exact
            path="/app/admin/config"
            render={props => <PageAdminConfig {...this.props} />}
          />
          <Route component={() => <Redirect to="/app/admin/surveys" />} />
        </Switch>
      </div>
    );
  }
}
